import { Product } from "../../App";
import "productCard.scss";
type cardProps = {
    card: Product;
};

const ProductCard = ({ card }: cardProps) => {
    return (
        <li>
            <p>Id: {card.id}</p>
            <p>Name: {card.name}</p>
            <p>Year: {card.year}</p>
            <p>color: {card.color}</p>
            <p>pantoneValue: {card.pantone_value}</p>
            <hr />
        </li>
    );
};

export default ProductCard;
